void doesNotMatchWhenValueIsNull(){
    MatchResult match =
        new EqualToJsonPattern(
                "{\n"
                    + "    \"outer\": {\n"
                    + "        \"inner:\": {\n"
                    + "            \"wrong\": 1\n"
                    + "        }\n"
                    + "    }\n"
                    + "}",
                false,
                false)
            .match(null);

    assertFalse(match.isExactMatch());
    assertThat(match.getDistance(), is(1.0));
  }

void doesNotMatchWhenValueIsEmptyString(){
    MatchResult match =
        new EqualToJsonPattern(
                "{\n"
                    + "    \"outer\": {\n"
                    + "        \"inner:\": {\n"
                    + "            \"wrong\": 1\n"
                    + "        }\n"
                    + "    }\n"
                    + "}",
                false,
                false)
            .match("");

    assertFalse(match.isExactMatch());
    assertThat(match.getDistance(), is(1.0));
  }
